import React from 'react';
import DeleteButton from './DeleteButton';

const CommentItem = ({ comment }) => {
    return (
        <div className="comment-item">
            <p>{comment.content}</p>
            <DeleteButton commentId={comment.id} />
        </div>
    );
};

export default CommentItem;
